class LoggerWriter:
    def __init__(self, logger, level):
        self.logger = logger
        self.level = level

    def write(self, message):
        # Konsolda görmek için stdout'a yaz
        sys.__stdout__.write(message)
        # Log dosyasına yaz
        self.logger.log(self.level, message)

    def flush(self):
        pass

