def find_neighbors(mol2_file, target_atom):
    neighbors = {}
    atom_section = False
    bond_section = False
    atom_ids_symbols = {}
    atom_ids_bonds = {}
    target_atom_ids = []

    with open(mol2_file, 'r') as file:
        for line in file:
            if "@<TRIPOS>ATOM" in line:
                atom_section = True
                bond_section = False
                continue
            elif "@<TRIPOS>BOND" in line:
                atom_section = False
                bond_section = True
                continue
            elif "@<TRIPOS>SUBSTRUCTURE" in line:
                break

            if atom_section:
                columns = line.split()
                atom_id = int(columns[0])
                atom_symbol = columns[5]

                atom_ids_symbols[atom_id] = atom_symbol
                
                if atom_symbol == target_atom:
                    target_atom_ids.append(atom_id)
                    
            elif bond_section:
                columns = line.split()
                bond_ids = [int(columns[1]), int(columns[2])]
                
                for target_atom_id in target_atom_ids:
                    if target_atom_id in bond_ids:
                        bond_ids.remove(target_atom_id)
                        other_atom_id = bond_ids[0]
                        
                        if target_atom_id not in neighbors:
                            neighbors[target_atom_id] = []
                        
                        neighbors[target_atom_id].append([other_atom_id, atom_ids_symbols[other_atom_id]])

    return neighbors, target_atom_ids

neighbors,pd_ids = find_neighbors(gmol2, METAL)
