def get_atom_coordinates(mol2_file, atom_numbers):
    coordinates = {}
    atom_section = False

    with open(mol2_file, 'r') as file:
        for line in file:
            if "@<TRIPOS>ATOM" in line:
                atom_section = True
                continue
            elif "@<TRIPOS>BOND" in line or "@<TRIPOS>SUBSTRUCTURE" in line:
                atom_section = False

            if atom_section:
                columns = line.split()
                atom_id = int(columns[0])
                if atom_id in atom_numbers:
                    x, y, z = map(float, columns[2:5])
                    coordinates[atom_id] = (x, y, z)
                    if len(coordinates) == len(atom_numbers):
                        break
    return coordinates

def angle_between(v1, v2):
    dot_product = np.dot(v1, v2)
    magnitude_product = np.linalg.norm(v1) * np.linalg.norm(v2)
    angle_rad = np.arccos(dot_product / magnitude_product)
    return np.degrees(angle_rad)

def calculate_angle(mol2_file, atom_numbers):
    coords = get_atom_coordinates(mol2_file, atom_numbers)

    # Vektörlerin oluşturulması
    BA = np.array(coords[atom_numbers[0]]) - np.array(coords[atom_numbers[1]])
    BC = np.array(coords[atom_numbers[2]]) - np.array(coords[atom_numbers[1]])
    return angle_between(BA, BC)

def get_cis_combinations(mol2_file, Metal, komsulari):
    cis_combinations = []

    for combo in combinations(komsulari, 2):
        angle = calculate_angle(mol2_file, [combo[0], Metal[0], combo[1]])
        
        if angle < 111:
            print(f"{combo[0]}-{Metal[0]}-{combo[1]} are cis. Angle is: {angle:.2f} derece.")
            cis_combinations.append((combo[0], combo[1]))

    return cis_combinations

