def order_connections(connections):
    if len(d)>4:
        exit("FATAL ERROR:two Pd center detected. For this type of molecules, please use assign.py v1.0 version ")
    else:
	    pass
    if not connections:
        return []

    ordered = [connections[0]]
    connections.remove(ordered[0])

    while connections:
        last_added = ordered[-1]
        next_added = None

        for connection in connections:
            if connection[0] == last_added[1]:
                next_added = connection
                break
            elif connection[1] == last_added[1]:
                next_added = (connection[1], connection[0])
                break

        if next_added:
            ordered.append(next_added)
            connections.remove(next_added if next_added in connections else (next_added[1], next_added[0]))

    return [item for sublist in ordered for item in sublist][::2]

