def dihedral_ters(dihedraller):
    yeniler = []
    for dihedral in dihedraller:
        # Terim ve parametreleri ayırma
        terim, parametreler = dihedral.split(' ', 1)
        # Terimi atomlarına ayırma
        atomlar = terim.split('-')
        # Atomların yerlerini değiştirme
        atomlar.reverse()
        yeni_terim = '-'.join(atomlar)
        # Yeni dihedralı oluşturma
        yeni_dihedral = yeni_terim + ' ' + parametreler
        # Yeni dihedralın orijinal listede olup olmadığını kontrol etme
        ters_terimler = [entry.split(' ', 1)[0] for entry in dihedraller]
        if yeni_terim not in ters_terimler:
            yeniler.append(yeni_dihedral)
    # Yeni dihedralleri orijinal listeye ekleme
    dihedraller.extend(yeniler)
    return dihedraller

def angle_ters(acilar):
    yeniler = []
    for aci in acilar:
        # Terim ve parametreleri ayırma
        terim, parametreler = aci.split(' ', 1)
        # Terimi atomlarına ayırma
        atomlar = terim.split('-')
        # İlk ve son atomların yerlerini değiştirme
        atomlar[0], atomlar[-1] = atomlar[-1], atomlar[0]
        yeni_terim = '-'.join(atomlar)
        # Yeni açıyı oluşturma
        yeni_aci = yeni_terim + ' ' + parametreler
        # Yeni açının orijinal listede olup olmadığını kontrol etme
        if yeni_aci not in acilar:
            yeniler.append(yeni_aci)
    # Yeni açıları orijinal listeye ekleme
    acilar.extend(yeniler)
    return acilar

def bag_ters(baglar):
    yeniler = []
    for bag in baglar:
        # Bağ ve parametreleri ayırma
        terim, parametreler = bag.split(' ', 1)
        # Bağı atomlarına ayırma
        atomlar = terim.split('-')
        # Atomların yerlerini değiştirme
        atomlar.reverse() 
        yeni_terim = '-'.join(atomlar)
        # Yeni bağı oluşturma
        yeni_bag = yeni_terim + ' ' + parametreler
        # Yeni bağın orijinal listede olup olmadığını kontrol etme
        if not any(item.startswith(yeni_terim) for item in baglar):
            yeniler.append(yeni_bag)
    # Yeni bağları orijinal listeye ekleme
    baglar.extend(yeniler)
    return baglar

