def extract_one_atom_parameters(database, terms, char_count):
    parametre = []
    for data in database:
        for term in terms:
            if term[:char_count] in data[:char_count]:
                parametre.append(f"{data[:char_count]} {data[char_count+1:]}")
            else:
                pass  
    return parametre

def remove_duplicates(lines,x):
    unique_lines = []
    seen_prefixes = set()
    
    for line in lines:
        prefix = line[:x]
        if prefix not in seen_prefixes:
            seen_prefixes.add(prefix)
            unique_lines.append(line)
    return unique_lines

