def to_gaff_format(dihedral, sozluk):
    parts = dihedral.split('-')
    gaff_parts = [translate_one(part, sozluk) for part in parts]
    return '-'.join(gaff_parts)

def search_and_print_dihedrals(dihedrals, database, sozluk):
    METAL = "Pd"
    sozluk["Pd"]="Pd"
    z = set()
    for dihedral in dihedrals:
        gaff_format = to_gaff_format(dihedral, sozluk)

        # 2. veya 3. atom METAL'e eşitse, direkt default değeri sonuca ekleyelim.
        atoms = dihedral.split('-')
        if atoms[1] == METAL or atoms[2] == METAL:
            z.add(f"{dihedral}   0    0.000         0.000           0.000")
            continue  # Bu dihedral için veritabanı araması yapmaya gerek yok.
        # gaff formatını sadece "X-" ve "-X " eklemeleriyle genişletiyoruz.

        for entry in database:
            if dihedral[0:11] in entry[0:11]:
                z.add(f"{dihedral}{entry[11:]}")
            elif (atoms[0]=="X " or atoms[3]=="X ") and (fmt[3:8] in entry[3:8]):
                z.add(f"{atoms[0]}{dihedral[3:8]}{atoms[3]}{entry[11:]}")
                break  # İlgili format bulunduğunda diğer formatları kontrol etmeye gerek yok.
    return list(z)

def search_and_print_impropers(dihedrals, database, sozluk):
    METAL = "Pd"
    z = set()
    for dihedral in dihedrals:
        gaff_format = to_gaff_format(dihedral, sozluk)
        found_in_db = False
        # 2. veya 3. atom METAL'e eşitse, direkt default değeri sonuca ekleyelim.
        atoms = dihedral.split('-')
        if atoms[1] == METAL or atoms[2] == METAL:
            z.add(f"{dihedral}         1.1          180.0         2.0          Using the default value")
            continue  # Bu dihedral için veritabanı araması yapmaya gerek yok.
        # gaff formatını her atomda "X" olasılığına göre genişletiyoruz.
        parts = gaff_format.split('-')
        expanded_formats = [gaff_format]
        for i in range(len(parts)):
            tmp = parts.copy()
            tmp[i] = "X"
            expanded_formats.append('-'.join(tmp))

        for entry in database:
            for fmt in expanded_formats:
                if fmt in entry[0:11]:
                    z.add(f"{dihedral}{entry[11:]}")
                    found_in_db = True
                    break  # İlgili format bulunduğunda diğer formatları kontrol etmeye gerek yok.
            if found_in_db:
                break
        # Eğer veritabanında eşleşme bulunamadıysa, varsayılan değeri kullan.
        if not found_in_db:
            z.add(f"{dihedral}         1.1          180.0         2.0          Using the default value")

    return list(z)
