def to_gaff_format_angle(angle, sozluk):
    parts = angle.split('-')
    gaff_parts = [translate_one(part, sozluk) for part in parts]
    return '-'.join(gaff_parts)
def search_and_print_angle(angles, database, sozluk):
    results = []
    for angle in angles:
        gaff_format = to_gaff_format_angle(angle, sozluk)
        
        for entry in database:
            if angle in entry[0:8]:
                results.append(f"{angle}{entry[8:]}")
            elif gaff_format in entry[0:8]:
                results.append(f"{angle}{entry[8:]}")
                break
    return results
