def to_gaff_format_bond(bond, sozluk):
    parts = bond.split('-')
    gaff_parts = [sozluk.get(part, part) for part in parts]
    return '-'.join(gaff_parts)
def search_and_print_bond(bonds, database, sozluk):
    results = []
    for bond in bonds:
        gaff_format = to_gaff_format_bond(bond, sozluk)
        
        for entry in database:
            if gaff_format in entry[0:5]:
                results.append(f"{bond}{entry[5:]}")
                break
    return results
