def geride_nevar(istenen, bulunan, p):
    bulunan_liste = [i[:p] for i in bulunan]
    istenen_liste = [i[:p] for i in istenen]
    return set(istenen_liste) - set(bulunan_liste)

def write_data_to_file(filename, mass, bond, angle, dihedral, improper, nonbond):
    with open(filename, 'w') as f:
        f.write("Remark line goes here: assign.py\n")
        f.write("MASS\n")
        for item in mass:
            f.write(item + "\n")
        f.write("\nBOND\n")
        for item in bond:
            f.write(item + "\n")
        f.write("\nANGLE\n")
        for item in angle:
            f.write(item + "\n")
        f.write("\nDIHE\n")
        for item in dihedral:
            f.write(item + "\n")
        f.write("\nIMPROPER\n")
        for item in improper:
            f.write(item + "\n")
        f.write("\nNONBON\n")
        for item in nonbond:
            if not item.startswith(" "):  # Eğer satır boşlukla başlamıyorsa
                f.write("  " + item + "\n")
            else:  # Eğer satır zaten boşlukla başlıyorsa
                f.write(item + "\n")
        f.write("\n")

        
def translate_one(term, sozluk):
    for key, value in sozluk.items():
        term = term.replace(key, value)
    return term


